// eslint-disable-next-line 
import React, {Component} from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Reservation from './components/Reservation'
import ReservationList from './components/ReservaionList';
import Menubar from './components/menubar';
import ManagerMenubar from './components/managerMenubar';
import FinalPage from './components/finalPage';
import DateSelect from './components/dateSelect';
import SelectPage from './components/selectPage';
import ReserveListTotal from './components/reserveListTotal';
import Adminpagemenu from './components/adminPageMenu';
import WaitingList from './components/waitingList';
import ManageSys from './components/manageSys';


const table = {
  'name':'김미소',
  'pet':'달구',
  'address':'부산광역시',
  'telephone':'010-0000-0000',
  'gender': '여(중성화)',
  'species' : '믹스견(장모종)'
}

function App() {
  return (
    <div id = 'frame' >
          <Router>
          <Adminpagemenu />
          <Switch>
            <Route exact path="/adminpage/reservation/request" component={WaitingList} />
          </Switch>
         </Router>  
        <Menubar/>
        <Reservation
        name ={table.name}
        pet ={table.pet}
        address = {table.address}
        telephone = {table.telephone}
        gender = {table.gender}
        species = {table.species}/>
        <FinalPage/>
        <SelectPage/>
        <ReserveListTotal/>
        <ManagerMenubar/>
        {/* <Adminpagemenu/> */}
        {/* <WaitingList/> */}
        <ManageSys/>


    </div>
  );
 }

export default App;
